response:
\boxed{(-\sqrt{3},\sqrt{3})} 

समजावणी: दिलेल्या असमानतेतून -4 < x⁴ + 4x² < 21 पैकी, x⁴ + 4x² हा भाग सर्व वास्तविक x साठी किमान 0 असतो (कारण तो x² आणि x⁴ मध्ये विभागला जाऊ शकतो). त्यामुळे पहिली बाजू (x⁴ + 4x² > -4) आपण नेहमीच पूर्ण होते. त्यामुळे आपल्याला फक्त दुसरी बाजू x⁴ + 4x² < 21 यावर लक्ष केंद्रित करावे लागेल. 

x⁴ + 4x² < 21 या असमानतेला x² = u असे बदलल्यास u² + 4u - 21 < 0 होईल, ज्याचे मूळ u = 3 आणि u = -7 आहेत. u ≥ 0 असल्यानं, आपल्याला u ∈ [0, 3) मिळते. पुन्हा x² = u असल्याने x² < 3, म्हणजे |x| < √3. म्हणून उत्तर अंतराल स्वरूपात (-√3, √3) असे येते.
